import React from 'react';
import { Link } from 'react-router-dom';

const UserList=({users})=>{
  return(
    <div> 
      {users.map(user=>{
      return(
      <div 
        key={user.id}
      >
        <Link to={`/users/${user.id}`}>
          {user.name}
        </Link>
      </div>)
    })} </div>
  )
}
export default UserList
